shape_template:
ex:AvailabilityDumpShape
	a sh:NodeShape ;
	sh:targetClass void:Dataset ;
	sh:or (
		[
			sh:path void:dataDump ;
			sh:minCount 1 ;
		]
		[
			sh:path (dcat:distribution dcat:downloadURL) ;
			sh:minCount 1 ;
		]
	) .

ex:MachineReadableLicenseShape
	a sh:NodeShape ;
	sh:targetClass void:Dataset ;
	sh:property [
		sh:path dcterms:license ;
		sh:class dcterms:LicenseDocument ;
		sh:minCount 1 ;
	] .

ex:AuthenticityOfDatasetShape
	a sh:NodeShape ;
	sh:targetClass void:Dataset ;
	sh:or (
		[ sh:path dcterms:contributor ; sh:minCount 1 ; ]
		[ sh:path dcterms:creator ; sh:minCount 1 ; ]
		[ sh:path dcterms:publisher ; sh:minCount 1 ; ]
	) ;
	sh:or (
		[ sh:path dcterms:source ; sh:minCount 1 ; ]
		[ sh:path dcterms:provenance ; sh:minCount 1 ; ]
	) .

ex:UnderstandabilityDatasetMetadataShape
	a sh:NodeShape ;
	sh:targetClass void:Dataset ;
	sh:property [
		sh:path dcterms:title ;
		sh:minCount 1 ;
		sh:nodeKind sh:Literal ;
	] ;
	sh:property [
		sh:path dcterms:description ;
		sh:minCount 1 ;
		sh:nodeKind sh:Literal ;
	] ;
	sh:property [
		sh:path foaf:homepage ;
		sh:minCount 1 ;
		sh:class foaf:Document ;
	] .

ex:UnderstandabilityExtraMetadataShape
	a sh:NodeShape ;
	sh:targetClass void:Dataset ;
	sh:property [
		sh:path void:exampleResource ;
		sh:minCount 1 ;
	] ;
	sh:property [
		sh:path void:vocabulary ;
		sh:minCount 1 ;
	] ;
	sh:or (
		[
			sh:path void:uriRegexPattern ;
			sh:minCount 1 ;
		]
		[
			sh:path void:uriSpace ;
			sh:minCount 1 ;
			sh:nodeKind sh:Literal ;
		]
	) .

ex:UnderstandabilityExtraMetadataShape
	a sh:NodeShape ;
	sh:targetClass void:Dataset ;
	sh:property [
		sh:path void:exampleResource ;
		sh:minCount 1 ;
	] ;
	sh:property [
		sh:path void:vocabulary ;
		sh:minCount 1 ;
	] ;
	sh:or (
		[
			sh:path void:uriRegexPattern ;
			sh:minCount 1 ;
		]
		[
			sh:path void:uriSpace ;
			sh:minCount 1 ;
			sh:nodeKind sh:Literal ;
		]
	) .

ex:UnderstandabilityExtraMetadataShape
	a sh:NodeShape ;
	sh:targetClass void:Dataset ;
	sh:property [
		sh:path void:exampleResource ;
		sh:minCount 1 ;
	] ;
	sh:property [
		sh:path void:vocabulary ;
		sh:minCount 1 ;
	] ;
	sh:or (
		[
			sh:path void:uriRegexPattern ;
			sh:minCount 1 ;
		]
		[
			sh:path void:uriSpace ;
			sh:minCount 1 ;
			sh:nodeKind sh:Literal ;
		]
	) .

ex:UnderstandabilityExtraMetadataShape
	a sh:NodeShape ;
	sh:targetClass void:Dataset ;
	sh:property [
		sh:path void:exampleResource ;
		sh:minCount 1 ;
	] ;
	sh:property [
		sh:path void:vocabulary ;
		sh:minCount 1 ;
	] ;
	sh:or (
		[
			sh:path void:uriRegexPattern ;
			sh:minCount 1 ;
		]
		[
			sh:path void:uriSpace ;
			sh:minCount 1 ;
			sh:nodeKind sh:Literal ;
		]
	) .

ex:SerializationFormatsShape
	a sh:NodeShape ;
	sh:targetClass void:Dataset ;
	sh:property [
		sh:path void:feature ;
		sh:minCount 1 ;
		sh:maxCount 5 ;
		sh:in (
			<http://www.w3.org/ns/formats/N3>
			<http://www.w3.org/ns/formats/N-Triples>
			<http://www.w3.org/ns/formats/RDF_XML>
			<http://www.w3.org/ns/formats/RDFa>
			<http://www.w3.org/ns/formats/Turtle>
		) ;
	] .

ex:UsageExternalURIShape
	a sh:NodeShape ;
	sh:targetSubjectsOf owl:sameAs ;
	sh:property [
		sh:path owl:sameAs ;
		sh:pattern "^(?!DATASET_URI)" ;
	] .

ex:UsageHashURIsShape
	a sh:NodeShape ;
	sh:targetSubjectsOf rdf:type ;
	sh:or (
		[ sh:path rdf:type ; sh:hasValue rdfs:Class ; ]
		[ sh:path rdf:type ; sh:hasValue rdf:Property ; ]
		[ sh:path rdf:type ; sh:hasValue owl:NamedIndividual ; ]
		[ sh:pattern "^[^#]*$" ; ]
	) .

ex:LabelForEntitiesShape
	a sh:NodeShape;
	sh:targetSubjectsOf rdf:type;
	sh:or (
		[ sh:path rdf:type; sh:hasValue rdfs:Class; ]
		[ sh:path rdf:type; sh:hasValue rdf:Property; ]
		[ sh:path rdf:type; sh:hasValue owl:NamedIndividual; ]
		[ sh:path rdfs:label; sh:minCount 1; ]
	) .

ex:URIRegexComplianceShape
	a sh:NodeShape ;
	sh:targetSubjectsOf rdf:type;
	sh:or (
	[sh:path rdf:type; sh:hasValue rdfs:Class;]
	[sh:path rdf:type; sh:hasValue rdf:Property;]
	[sh:path rdf:type; sh:hasValue owl:NamedIndividual;]
	[sh:pattern "^URI_REGEX_PATTERN";]
	[sh:pattern "^URI_SPACE";]
	).

ex:URIRegexComplianceShape
	a sh:NodeShape ;
	sh:targetSubjectsOf rdf:type;
	sh:or (
	[sh:path rdf:type; sh:hasValue rdfs:Class;]
	[sh:path rdf:type; sh:hasValue rdf:Property;]
	[sh:path rdf:type; sh:hasValue owl:NamedIndividual;]
	[sh:pattern "^URI_REGEX_PATTERN";]
	[sh:pattern "^URI_SPACE";]
	).

ex:URIsParametersShape
	a sh:NodeShape ;
	sh:targetSubjectsOf rdf:type;
	sh:or (
	[sh:path rdf:type; sh:hasValue rdfs:Class;]
	[sh:path rdf:type; sh:hasValue rdf:Property;]
	[sh:path rdf:type; sh:hasValue owl:NamedIndividual;]
	[sh:not [ sh:pattern "\?.+=.*" ; ] ;]
	).

ex:URIsLengthShape
	a sh:NodeShape ;
	sh:targetSubjectsOf rdf:type;
	sh:or (
	[sh:path rdf:type; sh:hasValue rdfs:Class;]
	[sh:path rdf:type; sh:hasValue rdf:Property;]
	[sh:path rdf:type; sh:hasValue owl:NamedIndividual;]
	[sh:maxLength LENGTH_VALUE;]
	).

ex:ProlixRDFFeaturesShape
	a sh:NodeShape ;
	sh:targetSubjectsOf rdf:type;
	sh:or (
	[sh:path rdf:type; sh:hasValue rdfs:Class;]
	[sh:path rdf:type; sh:hasValue rdf:Property;]
	[sh:path rdf:type; sh:hasValue owl:NamedIndividual;]
	[
	sh:not [
	sh:or (
	[ sh:class rdf:Statement ]
	[ sh:class rdf:List ]
	[ sh:class rdf:Seq ]
	[ sh:class rdf:Bag ]
	[ sh:class rdf:Alt ]
	)
	];
	]
	).

ex:DifferentLanguagesLabelsShape
	a sh:NodeShape ;
	sh:targetSubjectsOf rdfs:label;
	sh:property [
	sh:path rdfs:label;
	sh:datatype rdf:langString;
	].

ex:DifferentLanguagesDescriptionsShape
	a sh:NodeShape ;
	sh:targetSubjectsOf rdfs:comment;
	sh:property [
	sh:path rdfs:comment;
	sh:datatype rdf:langString;
	].

ex:SelfDescriptiveFormatEntitiesShape
	a sh:NodeShape ;
	sh:targetSubjectsOf rdf:type;
	sh:or (
	[sh:path rdf:type; sh:hasValue rdfs:Class;]
	[sh:path rdf:type; sh:hasValue rdf:Property;]
	[sh:path rdf:type; sh:hasValue owl:NamedIndividual
;]
	[ sh:nodeKind sh:IRI; ]
	).

ex:BlankNodesUsageEntitiesShape
	a sh:NodeShape ;
	sh:targetSubjectsOf rdf:type;
	sh:or (
	[sh:path rdf:type; sh:hasValue rdfs:Class;]
	[sh:path rdf:type; sh:hasValue rdf:Property;]
	[sh:path rdf:type; sh:hasValue owl:NamedIndividual;]
	[ sh:not [ sh:nodeKind sh:BlankNode ]; ]
	).

ex:InterlinkingCompletenessShape
	a sh:NodeShape ;
	sh:targetSubjectsOf rdf:type;
	sh:or (
	[ sh:path rdf:type; sh:hasValue rdfs:Class; ]
	[ sh:path rdf:type; sh:hasValue rdf:Property; ]
	[ sh:path rdf:type; sh:hasValue owl:NamedIndividual; ]
	[ sh:path owl:sameAs; sh:minCount 1; ]
	).

ex:InverseFunctionalPropertyShape
	a sh:NodeShape ;
	sh:targetObjectsOf PROPERTY_URI;
	sh:property [
		sh:path [ sh:inversePath PROPERTY_URI ]; sh:maxCount 1;
	].

ex:DeprecatedClassesShape
	a sh:NodeShape ;
	sh:targetSubjectsOf rdf:type;
	sh:or (
		[sh:path rdf:type; sh:hasValue rdfs:Class;]
		[sh:path rdf:type; sh:hasValue rdf:Property;]
		[sh:path rdf:type; sh:hasValue owl:
		NamedIndividual;]
		[
		sh:path rdf:type;
		sh:not [ sh:in (CLASSES_LIST); ];
		]
	).

ex:MisplacedPropertiesShape
	a sh:NodeShape ;
	sh:targetNode PROPERTY_URI;
	sh:property [
	sh:path [sh:inversePath rdf:type];
	sh:maxCount 0;
	].

ex:MisplacedClassesShape
	a sh:NodeShape ;
	sh:targetSubjectsOf rdf:type;
	sh:or (
	[sh:path rdf:type; sh:hasValue rdfs:Class;]
	[sh:path rdf:type; sh:hasValue rdf:Property;]
	[sh:path rdf:type; sh:hasValue owl:NamedIndividual;]
	[
	sh:path CLASS_URI;
	sh:maxCount 0;
	]
	).

ex:CorrectRangeShape
a sh:NodeShape ;
sh:targetSubjectsOf PROPERTY_URI;
sh:property [
sh:path PROPERTY_URI;
sh:datatype DATATYPE; % or sh:class CLASS
].

ex:CorrectRangeShape
a sh:NodeShape ;
sh:targetSubjectsOf PROPERTY_URI;
sh:property [
sh:path PROPERTY_URI;
sh:nodeKind sh:BlankNodeOrIRI;
].

ex:CorrectRangeShape
a sh:NodeShape ;
sh:targetSubjectsOf PROPERTY_URI;
sh:property [
sh:path PROPERTY_URI;
sh:nodeKind sh:Literal;
].

ex:CorrectRangeShape
a sh:NodeShape ;
sh:targetSubjectsOf PROPERTY_URI;
sh:property [
sh:path PROPERTY_URI;
sh:or (
[ sh:nodeKind sh:BlankNodeOrIri; ]
[ sh:nodeKind sh:Literal; ]
);
].

ex:CorrectDomainShape
a sh:NodeShape ;
sh:targetSubjectsOf PROPERTY_URI;
sh:class CLASS.

ex:CorrectDomainShape
a sh:NodeShape ;
sh:targetSubjectsOf PROPERTY_URI;
sh:nodeKind sh:BlankNodeOrIRI.

ex:EntitiesDisjointClassesShape
	a sh:NodeShape ;
	sh:targetClass CLASS_URI;
	sh:not [ sh:class DISJOINT_CLASS_URI].

ex:IrreflexivePropertyShape
	a sh:NodeShape ;
	sh:targetSubjectsOf PROPERTY_URI;
	sh:disjoint PROPERTY_URI.

ex:SelfDescriptiveFormatPropertiesShape
a sh:NodeShape ;
sh:targetObjectsOf PROPERTY_URI;
sh:nodeKind sh:IRI.

ex:MisuseObjectPropertiesShape
	a sh:NodeShape ;
	sh:targetSubjectsOf PROPERTY_URI;
	sh:property [
		sh:path PROPERTY_URI;
		sh:nodeKind sh:BlankNodeOrIRI;
	].

ex:MisuseDatatypePropertiesShape
	a sh:NodeShape ;
	sh:targetSubjectsOf PROPERTY_URI;
	sh:property [
	sh:path PROPERTY_URI;
	sh:nodeKind sh:Literal;
	].

ex:FunctionalPropertyShape
	a sh:NodeShape ;
	sh:targetSubjectsOf PROPERTY_URI;
	sh:property [
		sh:path PROPERTY_URI;
		sh:maxCount 1;
	].

ex:AsymmetricPropertyShape
	a sh:NodeShape ;
	sh:targetSubjectsOf PROPERTY_URI;
	sh:property [
		sh:path [sh:inversePath PROPERTY_URI];
		sh:disjoint PROPERTY_URI;
	].

ex:NotNamedIndividualShape
	a sh:NodeShape;
	sh:property [
		sh:path rdf:type ;
		sh:not [ sh:hasValue owl:NamedIndividual ] ;
	].
ex:SchemaCompletenessClassUsageShape
	a sh:NodeShape ;
	sh:targetNode CLASS_URI ;
	sh:property [
		sh:path [ sh:inversePath rdf:type ] ;
		sh:minCount 1 ;
		sh:qualifiedValueShape [
			sh:node ex:NotNamedIndividualShape ;
		];
		sh:qualifiedMinCount 1 ;
	].

ex:MalformedLiteralShape
	a sh:NodeShape ;
	sh:targetSubjectsOf PROPERTY_URI;
	sh:property [
	sh:path PROPERTY_URI ;
	sh:datatype DATATYPE_URI;
	].

ex:DeprecatedPropertiesUsageShape
	a sh:NodeShape ;
	sh:targetSubjectsOf rdf:type;
	sh:or (
		[sh:path rdf:type; sh:hasValue rdfs:Class;]
		[sh:path rdf:type; sh:hasValue rdf:Property;]
		[sh:path rdf:type; sh:hasValue owl:
		NamedIndividual;]
		[ sh:path PROPERTY_URI; sh:maxCount 0; ]
	).

ex:LabelForClassesShape
	a sh:NodeShape;
	sh:targetClass rdfs:Class;
	sh:property [
		sh:path rdfs:label; sh:minCount 1;
	].

ex:LabelForPropertiesShape
	a sh:NodeShape ;
	sh:targetClass rdf:Property;
	sh:property [
		sh:path rdfs:label; sh:minCount 1;
	].

ex:UndefinedPropertyShape
	a sh:NodeShape ;
	sh:targetNode PROPERTY_URI;
	sh:property [
		sh:path rdf:type;
		sh:hasValue rdf:Property;
		sh:minCount 1;
	].

ex:UndefinedClassShape
	a sh:NodeShape ;
	sh:targetNode CLASS_URI;
	sh:property [
		sh:path rdf:type;
		sh:hasValue rdfs:Class;
		sh:minCount 1;
	].
